import React from "react";
import githubLogo from '../assets/github.svg'

function Socials() {
    const contactDeets = [
        {
            method: "LinkedIn",
            link: "https://www.linkedin.com/in/eli-chase-16b146256/",
        },
        {
            method: "GitHub",
            link: "https://github.com/eschase4",
        },
    ]
    return (
        <section id="socials">
            <div className="container">
                
            <a href="github.com"><img src={githubLogo} alt="githubLogo"/></a>
            </div>
            <script src="https://kit.fontawesome.com/faae216101.js" crossorigin="anonymous"></script>
        </section>
    )
}

export default Socials
